VALUES ('20031800', 'Saucisse fromage-paprika', 'GeﬂügeI-Wiener Käse-Paprika, geräuchert. Zutaten: 63% Geﬂügelfleisch (Truthahn), 10% Emmentaler, 10% Paprika  rot. Trinkwasser, 6% Geflügelfett mit Haut (Truthahn), Nitritpôkelsalz (Speise— salz, Konservierungsstoff: Natriumnitrit), Gewürze, Stabilisator: Natriumcitrate; Antioxidationsmittel: Ascorbinsäure; Dextrose, Gewürzextrakte, Schafsaitling, Buchenholzrauch. Dieses Produkt ist glutenfrei. Unter Schutzatmosphâre verpackt. Nach dem Ôﬁnen innerhalb von 2-3 Tagen verzehren. Zuhereitungsempfehlung: Reichlich Wasser in einem Topf zum Kochen brin— gen. Topf von der Herdplatte nehmen und die Truthahn—Wiener für 8 Minuten im  heiﬁen Wasser ziehen lassen. Vorsicht, flüssiger Käse ist heiﬁ! 60m W', 'https://static.openfoodfacts.org/images/products/20031800/front_fr.4.400.jpg', '18', '6.8', '0.6', '0.5', '', '14', '2.2', '0.866141732283465', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20031817', 'Salat Pulled Chicken-Mais', 'Salatmischung [40% Quinoa, gekocht (Wasser, vorgegarter Quinoa, Antioxidationsmittel: Ascorbinsäure), Gemüse in veränderlichen Gewichtsanteilen (Lollo Rosso, Lollo Bionda, Radicchio, Frisée, Endivie, Chinakohl), 12% Pulled-Chicken (Pouletfleischerzeugnis flüssiggewürzt, gegart, zerrissen (80% Pouletfleisch, Wasser, Gewürze, Speisesalz, Rohrzucker, Reismehl, Stabilisator: Triphosphate; Zucker, Dextrose, Rauchsalz (Speisesalz, Rauch)), 10% Mais], Dressing [Joghurt, Salatmayonnaise (Rapsöl, Wasser, Branntweinessig, Maisstärke, Zucker, Eigelb*, Speisesalz, Senf (Wasser, Senfsaaten, Branntweinessig, Speisesalz, Gewürze), Verdickungsmittel: Xanthan, Johannisbrotkernmehl; Säuerungs - mittel: Citronensäure, Apfelsäure; Süssungsmittel: Saccharin), Apfelsaft aus Apfelsaftkonzentrat, Ketchup (70% Tomatenmark einfach konzentriert, Zucker, modifizierte Stärke, Branntweinessig, Speisesalz, Gewürze, Säuerungsmittel: Citronensäure), Zitronensaft aus Zitronensaftkonzentrat, Speisesalz, Senf (Wasser, Senfsaaten, Branntweinessig, Speisesalz, Zucker, Gewürze, natürliches Aroma), schwarzer Pfeffer, Schnittlauch, Kräuter.] *von Eiern aus Bodenhaltung. Kann Spuren von Schalenfrüch - ten (Nüssen) enthalten. Ungeöffnet bei max. +7°C zu verbrauchen bis: siehe Aufdruck Oberfolie. Verzehrfertig. FR Mélange de salades avec quinoa blanc, produit à base de viande de poulet, mais et vinaigrette maison. Avec sucre et édulcorants. Ingrédients: mélange de salades [40% quinoa (quinoa cuit (eau, quinoa cuit, antioxydant: acide ascorbique), légumes en quantité variable (Lollo Rosso, Lollo Bionda, Radicchio, frisée, endive, chou de Chine), 12% pulled chicken (produit à base de viande de poulet assaisonnée, cuite, découpée (80% viande de poulet, eau, épices, sel de cuisine, sucre de canne, riz, stabilisant: triphospahtes; sucre, dextrose, sel fumé (sel de cuisine, fumé)), 10% maïs], vinaigrette [yogourt, mayonnaise à salade (huile de colza, eau, vinaigre d\'alcol, amidon de mais, sucre, jaune d\'oeuf, sel de cuisine, moutarde (eau, graines de moutarde, vinaigre d\'alcool, sel de cuisine, épices), épaississant: gomme xanthane, farine de graines de caroube; acidifiants: acide citrique, acide malique; édulcorant: saccharine), jus de pomme concentré, ketchup (70% purée de tomates concentré, sucre, amidon modifié, vinaigre d\'alcool, sel de cuisine, épices, acidifiant: acide citrique), jus de citron concentré, sel de cuisine, moutarde (eau, graines de moutarde, vinaigre d\'alcool, sel de cuisine, sucre, épices, arôme naturel), poivre noir, ciboulette, herbes]. *ceuf d\'élevage au sol. Peut contenir des traces de fruits à coque (noix). Non ouvert, à conserver à +7°C max. et à consommer jusqu\'au: voir ci-dessus. Prêt à la consommation. I Insalata mista con quinoa bianca, prodotto a base di carne di pollo, mais e house dressing. Con zuccheri ed edulcorante. Ingredienti: insalata mista [140% quinoa cotta (acqua, quinoa cotta), antiossidante: acido ascorbico), ortaggi, in proporzione variabile (lollo rossa, lollo bionda, radicchio, riccia, indivia, cavolo cinese), 12% pulled chicken (prodotto a base di carne di pollo speziata, sfilacciata (80% carne di pollo, acqua, spezie, sale da cucina, zucchero di canna, farina di riso, stabilizzan - te: trifosfati; zucchero, destrosio, sale fumo (sale da cucina, fumo)), 10% mais], condimento [(yogurt, maionese per isalata (olio di colza, acqua, aceto d\'alcol, amido di mais, zucchero, turolo d\'uovo*, sale da cucina, senape (acqua, semi di senape, aceto d\'aclol, sale da cucina, spezie), addensante: gomma di xanthan, farina di semi di carube, acido citrico, acido malico; edulcorante: saccarina), succo di mele da concentrato, ketchup (70% concentrato di pomodoro, zucchero, amido modificato, aceto d\'alcol, sale da cucina, spezie, acidificante: acido citrico), succo di limone da concentrato, sale da cucina, senape (aqua, semi di senape, aceto d\'alcol, sale da cucina, ma naturale), pepe nero, erba cipollina, erbe aromatiche]. *uova da allevamento a terra. Può contenere tracce di frutta a guscio. Da conserv +7°C max. Da consumare entro (in confezione integra): vedere disopra. Pronto al consumo. Salatmischung/Mélange 350g Nettogewicht:/Poids net:/Peso netto: 250g de salade/Insalata mista 100 m/ House Dressing/Vinaigrette maisoi House dressing', 'https://static.openfoodfacts.org/images/products/20031817/front_de.3.400.jpg', '5.1', '0.8', '10.9', '2.6', '', '4.1', '0.71', '0.279527559055118', '', '1');

